import { useState } from 'react';
import {
    Box,
    Autocomplete,
    TextField,
} from '@mui/material';
import { AirtableIntegration } from './integrations/airtable';
import { NotionIntegration } from './integrations/notion';
import { DataForm } from './data-form';
import { authorizeHubSpot, getHubSpotItems } from './integrations/hubspot';

const integrationMapping = {
    'Notion': NotionIntegration,
    'Airtable': AirtableIntegration,
    'HubSpot': ({ user, org, integrationParams, setIntegrationParams }) => {
        const handleAuthorize = async () => {
            await authorizeHubSpot(user, org);
        };

        const handleFetchItems = async () => {
            const items = await getHubSpotItems(user, org);
            setIntegrationParams({
                type: 'HubSpot',
                credentials: { user, org, items },
            });
        };

        return (
            <Box display='flex' flexDirection='column' sx={{ mt: 2 }}>
                <TextField
                    label="HubSpot Authorization"
                    value="Click to authorize HubSpot integration"
                    InputProps={{ readOnly: true }}
                    sx={{ mt: 2 }}
                />
                <Box display="flex" justifyContent="space-between" sx={{ mt: 2 }}>
                    <button onClick={handleAuthorize}>Authorize</button>
                    <button onClick={handleFetchItems}>Fetch Items</button>
                </Box>
            </Box>
        );
    },
};

export const IntegrationForm = () => {
    const [integrationParams, setIntegrationParams] = useState({});
    const [user, setUser] = useState('TestUser');
    const [org, setOrg] = useState('TestOrg');
    const [currType, setCurrType] = useState(null);
    const CurrIntegration = integrationMapping[currType];

    return (
        <Box display='flex' justifyContent='center' alignItems='center' flexDirection='column' sx={{ width: '100%' }}>
            <Box display='flex' flexDirection='column'>
                <TextField
                    label="User"
                    value={user}
                    onChange={(e) => setUser(e.target.value)}
                    sx={{ mt: 2 }}
                />
                <TextField
                    label="Organization"
                    value={org}
                    onChange={(e) => setOrg(e.target.value)}
                    sx={{ mt: 2 }}
                />
                <Autocomplete
                    id="integration-type"
                    options={Object.keys(integrationMapping)}
                    sx={{ width: 300, mt: 2 }}
                    renderInput={(params) => <TextField {...params} label="Integration Type" />}
                    onChange={(e, value) => setCurrType(value)}
                />
            </Box>
            {currType &&
                <Box>
                    <CurrIntegration user={user} org={org} integrationParams={integrationParams} setIntegrationParams={setIntegrationParams} />
                </Box>
            }
            {integrationParams?.credentials &&
                <Box sx={{ mt: 2 }}>
                    <DataForm integrationType={integrationParams?.type} credentials={integrationParams?.credentials} />
                </Box>
            }
        </Box>
    );
};
